import React from 'react';
import { Grid,Typography,Button } from '@mui/material';

export default function Home() {
  return (
    <Grid container columns={1}>
      <Grid item  sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'100%', textAlign: 'center'}}>
        <Typography variant='h2' sx={{marginBottom:'5rem'}}>
          Eden's Garden
        </Typography>
        <Typography variant='h6' sx={{marginBottom:'0.2rem'}}>
          Every year, the US wastes about 40% of the food it produces.
        </Typography>
        <Typography variant='h6' sx={{marginBottom:'3rem'}}>
          Meanwhile, over 41 million people in the US face hunger.
        </Typography>
        <Button variant='contained'>Help Us</Button>
      </Grid>
      <Grid item justifyItems="center" alignItems="center" sx={{ bgcolor: '#f32432', height: '30rem', width:'100%'}}>
      </Grid>
    </Grid>
  );
}
